import HeadlineLeague from "../../components/headlineLeague/headlineLeague";
import {useLocation } from "react-router-dom";
import "./teamInfo.css";
import Scoreboard from "../../components/scoreboard/scoreboard";
import Form from "../../components/scoreboard/form/form";

const TeamInfo = () =>  {

    const location = useLocation();
    const { pos, logo, team, played, pts, gd, tournament, form, leagueNum } = location.state || {};

    console.log(leagueNum);

    return (
        <div className="teamInfo-wrap">
            <HeadlineLeague team={team} headlineLogo={logo} leagueNum={leagueNum} />
            <div className="team-form panel">
                <span className="team-form-txt">Team Form</span>
                <Form form={form}/>
            </div>
            <Scoreboard leagueNum={leagueNum} />

        </div>
    );
}

export default TeamInfo;
